import Aside from "../Components/Aside";
import "./Locker.css";
import Locker_sec_left from ".//Topnav_section/Locker_sec_left";
import Locker_sec_right from ".//Topnav_section/Locker_sec_right";

export default function L_App1() {
  return (
    <>
      <Aside />

      <div className="form-block">
        <Locker_sec_left />

        <Locker_sec_right />
      </div>
    </>
  );
}
